RECORDS["_193"] = new MedievalDocuments("_193", 1655, "Dumitra, soția lui Cornea postelnic din Bălcești, dăruiește pentru pomană mănăstirii Tismana 3 rumâni din satul Masloși și 2 țigănci, din zestre și din cumpărături.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dumitra", null, "Țara Românească", "2");
RECORDS["_194"] = new MedievalDocuments("_194", 1655, "Pârvul mare vistier vinde lui Cazan al doilea postelnic moșia de la Suharna, j. Ilfov, cu rumâni, cumpărată de la Vasile aga.", "Română", "Microfilm", "Original", "Constantin Șerban", "Pârvul", null, "Țara Românească", "2");
RECORDS["_195"] = new MedievalDocuments("_195", 1655, "Constantin Șerban voievod întărește mănăstirii Argeș și egumenului Nicolae vinăriciul din satul Șuașul <j. Vâlcea>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "2");
RECORDS["_196"] = new MedievalDocuments("_196", 1655, "Mihai călăraș din Drăgăiești, j. Dâmbovița, împreună cu soția sa, Neaga și fiii lor, Oprea și Stan, vând lui Gaula postelnic o livadă de fan pentru 6 ughi și jumătate, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Mihai împreună cu soția sa, Neaga și fiii lor, Oprea și Stan", null, "Țara Românească", "2");
RECORDS["_197"] = new MedievalDocuments("_197", 1655, "Toți sătenii din Steanca <j. Ialomița>, mari și mici, dau unchiașului Ioan din Futești moșia lui Radul și Nedelco din Steanca pusă zălog, deoarece acesta le-a plătit 5 ughi și 2 costande pentru mierea domnească și găleată.", "Română", "Hârtie", "Original", "Constantin Șerban", "Toți sătenii din Steanca", null, "Țara Românească", "2");
RECORDS["_198"] = new MedievalDocuments("_198", 1655, "Radul și Zahariia vând lui Stanciul Moldoveanul un răzor de vie <la Gorgani, în dealul Brătuleștilor, j. Muscel>, cu 15 ughi.", "Română", null, "Copie", "Constantin Șerban", "Radul și Zahariia", null, "Țara Românească", "2");
RECORDS["_199"] = new MedievalDocuments("_199", 1655, "Antonie din Negoiești dăruiește mănăstirii Mărgineani și egumenului Mitrofan o vie la Orlea <j. Prahova>.", "Română", null, "Copie", "Constantin Șerban", "Antonie", null, "Țara Românească", "2");
RECORDS["_200"] = new MedievalDocuments("_200", 1655, "Coman și Iane din Dragomirești, Stanciu din Câmpulung și Badea din Suslănești <j. Muscel>, împart în 3 părți o moșie și venitul ei rămase de la un anume Micul.", "Română", "Hârtie", "Original", "Constantin Șerban", "Coman și Iane din Dragomirești, Stanciu din Câmpulung și Badea din Suslănești", null, "Țara Românească", "2");
RECORDS["_201"] = new MedievalDocuments("_201", 1655, "Drăgușin cumpără de la Radostoe un rozor de loc din Valea Podului pană în Cacova, 8 stânjeni cu 130 bani gata.", "Română", null, "Copie", "Constantin Șerban", "Drăgușin", null, "Țara Românească", "2");
RECORDS["_202"] = new MedievalDocuments("_202", 1655, "Birnicii din satul Gorăsti <j. Rm. Sărat> zălogesc lui Toma și fratelui său, Radu, ocină la Gârbovi, partea lui Tatomir, pentru 8 ughi și 30 de bani.", "Română", null, "Copie", "Constantin Șerban", "Birnicii din satul Gorăsti", null, "Țara Românească", "2");
RECORDS["_203"] = new MedievalDocuments("_203", 1655, "Iacov dăruiește nepotului său, Stoicăi, a surorii sale Negoiei, toată partea lui de moșie, să aibă cine să-l pomenească.", "Română", "Hârtie", "Original", "Constantin Șerban", "Iacov", null, "Țara Românească", "2");
RECORDS["_204"] = new MedievalDocuments("_204", 1655, "Megieșii bătrâni din jurul satului Prestolul <j. Mehedinți> adeveresc, din porunca domnului, la cererea egumenului mănăstirii Cozia, că moșia este a mănăstirii și nu a lui Gruia.", null, null, "Copie", "Constantin Șerban", "Megieșii bătrâni din jurul satului Prestolul", null, "Țara Românească", "2");
RECORDS["_205"] = new MedievalDocuments("_205", 1655, "Stoica vinde Gherghinei din Vaideel partea lui de moșie <din Muscel, j. Sac>, cu 6 ughi.", "Română", null, "Copie", "Constantin Șerban", "Stoica", null, "Țara Românească", "2");
RECORDS["_206"] = new MedievalDocuments("_206", 1655, "Toma și fratele său, Barbul, adeveresc că au cumpărat 6 pământuri arătoare cu 4 ughi și 2 costande de la Porumbu, fiul lui Năstase <in Pârscov, j. Buzău>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Toma și fratele său, Barbul", null, "Țara Românească", "2");
